n_workers), performance_report(filename=f\"dask_performance_report_{n_workers}.html\"):\n        \n        evaluation_delayed = evaluate_model_dask(model, val_loader)\n        elapsed_time, (images_savings, labels_savings, probs_savings, preds_savings, accuracy) = evaluation_delayed.compute()\n        results.append((n_workers, elapsed_time, accuracy))\n        print(f\"Number of workers: {n_workers}, Elapsed time: {elapsed_time}\")\n\n# Shutdown Dask client and cluster\nclient.close()\ncluster.close()\n\n        &lt;/pre&gt;\n        "}}}},{"type":"object","name":"TabPanel","id":"p3003","attributes":{"title":"Task Stream","child":{"type":"object","name":"Figure","id":"p2647","attributes":{"name":"task_stream","sizing_mode":"stretch_both","x_range":{"type":"object","name":"DataRange1d","id":"p2645","attributes":{"range_padding":0}},"y_range":{"type":"object","name":"DataRange1d","id":"p2646","attributes":{"range_padding":0}},"x_scale":{"type":"object","name":"LinearScale","id":"p2657"},"y_scale":{"type":"object","name":"LinearScale","id":"p2658"},"title":{"type":"object","name":"Title","id":"p2650","attributes":{"text":"Task Stream"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p2687","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p2642","attributes":{"selected":{"type":"object","name":"Selection","id":"p2643","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p2644"},"data":{"type":"map","entries":[["start",[]],["duration",[]],["key",[]],["name",[]],["color",[]],["duration_text",[]],["worker",[]],["y",[]],["worker_thread",[]],["alpha",[]]]}}},"view":{"type":"object","name":"CDSView","id":"p2688","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p2689"}}},"glyph":{"type":"object","name":"Rect","id":"p2684","attributes":{"x":{"type":"field","field":"start"},"y":{"type":"field","field":"y"},"width":{"type":"field","field":"duration"},"height":{"ty
